import React from "react";
import "../../styles/Conceptos.css";

const Conceptos = () => {
    const handleClick = (e) => {
        console.log(e);
    };

    return (
        <div className='all-conceptos'>
            <div className='item-avance' onClick={handleClick} name='fresado'>
                <p>Fresado</p>
            </div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
            <div className='item-avance'></div>
        </div>
    );
};

export default Conceptos;
